import React, { Component } from 'react';

class Copyright extends Component
{
    render()
    {
        return (
          <section class="copyright py-4 text-center text-white">
            <div class="container">
              <small>Copyright &copy; MID Lab 2019</small>
            </div>
          </section>
        );
    }
}

export default Copyright;
